import React from 'react';
import { NavLink } from 'react-router-dom';
import './Navigation.css'

import logo from '../../../assets/logo.svg'
import discover from '../../../assets/discover.png';


const Navigation = () => (
  <div className="Navigation">
    <div>
      <NavLink activeClassName="active" exact to='/'>DISCOVER</NavLink>
      <NavLink activeClassName="active" to='/library'>LIBRARY</NavLink>
    </div>
    <div>
      <NavLink activeClassName="active" exact to='/'><img src={logo} alt=""/></NavLink>
    </div>
    <div>
      <span>search tab</span>
      <span>sign up</span>
    </div>
  </div>
);

export default Navigation;
